package setup

import (
	"fmt"
	"project-se67/entity/food_service"
	"time"
	"gorm.io/gorm"
)

func SetupFoodServiceDatabase(db *gorm.DB) {
	// Auto-migrate tables
	db.AutoMigrate(
		&food_service.FoodCategory{},
		&food_service.Menu{},
		&food_service.Order{},
		&food_service.OrderDetail{},
	)

	// Create sample FoodCategories
	foodCategories := []food_service.FoodCategory{
		{Name: "Beverages"},
		{Name: "Main Dishes"},
		{Name: "Appetizers"},
		{Name: "Desserts"},
		{Name: "Salads"},
	}

	// Save food categories to database
	for i := range foodCategories {
		db.Create(&foodCategories[i])
	}

	// Create sample Menus
	menus := []food_service.Menu{
		{MenuName: "Coffee", Price: 100.0, Description: "A warm, rich, and aromatic brewed coffee, freshly ground and brewed to perfection. Perfect for a morning pick-me-up or a relaxing break.", ImageMenu: "data:image/jpeg;base64,", FoodCategoryID: foodCategories[0].ID},
		{MenuName: "Tea", Price: 80.0, Description: "Refreshing green tea with a delicate flavor and soothing aroma. A healthy choice to rejuvenate your day.", ImageMenu: "data:image/jpeg;base64,", FoodCategoryID: foodCategories[0].ID},
		{MenuName: "Pasta", Price: 350.0, Description: "Delicious spaghetti served with a rich and flavorful tomato sauce, perfectly cooked to al dente.", ImageMenu: "https://elavegan.com/wp-content/uploads/2021/10/hand-stirring-creamy-tomato-sauce-vegetable-pasta-in-black-skillet-500x500.jpg", FoodCategoryID: foodCategories[1].ID},
		{MenuName: "Steak", Price: 700.0, Description: "Juicy and tender grilled steak, cooked to your preference and served with a side of seasonal vegetables.", ImageMenu: "https://thekitchencommunity.org/wp-content/uploads/2021/09/shutterstock_138421859-steak.jpg", FoodCategoryID: foodCategories[1].ID},
		{MenuName: "Spring Rolls", Price: 150.0, Description: "Crispy and golden spring rolls stuffed with fresh vegetables and savory spices, served with a tangy dipping sauce.", ImageMenu: "https://www.connoisseurusveg.com/wp-content/uploads/2022/04/baked-spring-rolls-sq.jpg", FoodCategoryID: foodCategories[2].ID},
		{MenuName: "Garlic Bread", Price: 120.0, Description: "Crunchy and fragrant toasted garlic bread with a hint of herbs and butter. A perfect side dish or snack.", ImageMenu: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRSVE9hASYz7OTFxf8PJjlyLTt30U0WzjsVyQ&s", FoodCategoryID: foodCategories[2].ID},
		{MenuName: "Cheesecake", Price: 220.0, Description: "Rich and creamy cheesecake with a smooth texture and a buttery graham cracker crust. A dessert lover's dream.", ImageMenu: "https://thesaltycooker.com/wp-content/uploads/2021/10/vanillabeancheesecake-BLOG-1024x1024.jpg", FoodCategoryID: foodCategories[3].ID},
		{MenuName: "Brownie", Price: 200.0, Description: "Decadent chocolate brownie with a fudgy center and a slightly crispy top, served warm for maximum indulgence.", ImageMenu: "https://i0.wp.com/cookingwithbry.com/wp-content/uploads/chocolate-brownies-recipe.png?fit=1080%2C1080&ssl=1", FoodCategoryID: foodCategories[3].ID},
		{MenuName: "Caesar Salad", Price: 250.0, Description: "Fresh and crisp romaine lettuce topped with creamy Caesar dressing, croutons, and a sprinkle of Parmesan cheese.", ImageMenu: "https://www.seriouseats.com/thmb/uft17hHQtaxu54n5Wnkyj1OwLTM=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/the-best-caesar-salad-recipe-07-96dc413c536d466ca991675f92c1578e.jpg", FoodCategoryID: foodCategories[4].ID},
		{MenuName: "Greek Salad", Price: 280.0, Description: "A vibrant mix of fresh cucumbers, tomatoes, olives, and feta cheese, tossed with olive oil and herbs for a Mediterranean delight.", ImageMenu: "https://i0.wp.com/cookingwithbry.com/wp-content/uploads/Greek-Salad-Recipe-1.jpg?fit=1080%2C1080&ssl=1", FoodCategoryID: foodCategories[4].ID},
	}
	

	// Save menus to database
	for i := range menus {
		db.Create(&menus[i])
	}

	// Create a sample Order
	order := food_service.Order{
		OrderDate:   time.Now(),
		TotalAmount: menus[0].Price + menus[1].Price*2, // Adjust based on your needs
	}
	db.Create(&order)

	// Create sample OrderDetails
	orderDetails := []food_service.OrderDetail{
		{Quantity: 1, Amount: menus[0].Price, MenuID: menus[0].ID, OrderID: order.ID},
		{Quantity: 2, Amount: menus[1].Price * 2, MenuID: menus[1].ID, OrderID: order.ID},
	}

	// Save order details to database
	for i := range orderDetails {
		db.Create(&orderDetails[i])
	}

	fmt.Println("FOODSERVICE data has been added to the database with 10 menu items and 5 categories.")
}
